@import url(https://fonts.googleapis.com/css?family=Montserrat:regular,500,600,700,800,900);
:root * {
  font-family: Montserrat;
}
:root body {
  margin: 0;
  background: #2A1D18;
  color: #828C76;
  text-transform: uppercase;
}
:root li {
  list-style-type: none;
  padding-bottom: 10px;
}
:root h1 {
  font-weight: 700;
  font-size: 50px;
}
:root h2 {
  font-weight: 700;
}
:root p {
  font-weight: 400;
  font-size: 18px;
}
:root .navbar {
  background: #110B09;
}
:root .navbar .navbar-nav .nav-link {
  display: flex;
  color: #828C76;
  font-weight: bold;
  font-size: 24px;
  gap: 65px;
}
:root .navbar .navbar-nav .nav-link:hover {
  color: white;
}
:root .search-block {
  display: flex;
  flex-direction: row;
  justify-content: flex-end;
}
:root .search-block:hover {
  border-radius: 40px;
  border: solid 2px;
}
:root .search-block:hover > .input-txt {
  width: 240px;
  padding: 0 6px;
}
:root .search-block .input-txt {
  border-radius: 30px;
  width: 45px;
  transition: all 0.3s ease-in-out, transform 0.3s ease-in-out;
}
:root .search-block .search-btn {
  background: #110B09;
  border-radius: 50%;
  display: flex;
  justify-content: center;
  align-items: center;
  transition: 0.4s;
  color: white;
  text-decoration: none;
}
:root .input-block {
  flex-direction: column;
  align-items: flex-end;
  width: 27%;
  gap: 30px;
}
:root .input-block .email-input {
  border: solid 3px;
  border-color: #828C76;
  color: white;
  background: none;
  outline: none;
}
:root input {
  border: 0px;
  padding: 0.5rem;
  outline: none;
  height: 40px;
  border-radius: 5px;
  border-color: #828C76;
  background: none;
  color: white;
}
:root .form-control:focus {
  box-shadow: none;
}
:root .offcanvas-header .btn-close {
  background-color: none;
}
:root .container {
  max-width: 1640px;
  padding-left: 15px;
  padding-right: 15px;
}
:root .carousel {
  border-radius: 30px;
  box-shadow: 5px 5px 10px rgba(0, 0, 0, 0.5);
}
:root .carousel .carousel-inner {
  border-radius: 30px;
}
:root .content-style {
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  width: 100%;
  height: 100%;
  color: white;
  background: rgba(0, 0, 0, 0.4);
  --webkit-filter: blur(0px) saturate(2);
}
:root .content-style .background-shadow {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 80%;
  width: 50%;
  background: rgba(0, 0, 0, 0.6);
  --webkit-filter: blur(0px) saturate(2);
}
:root span {
  font-size: 1.2rem;
}
:root .img-slide {
  height: 50rem;
}
:root .carousel-caption {
  top: 30%;
  height: 50%;
  width: 70%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-around;
}
:root .carousel-caption .slide-title {
  font-size: 30px;
  font-weight: bold;
}
:root .carousel-caption .slide-text {
  font-size: 20px;
  font-weight: 500;
  width: 70%;
}
:root Button {
  text-transform: uppercase;
  font-weight: bold;
  font-size: 24px;
  border-radius: 10px;
  border: none;
}
:root .subscribe-btn {
  background-color: #828C76;
  width: 200px;
  border-radius: 7px;
}
:root .common-btn {
  background-color: #828C76;
  width: 300px;
  height: 70px;
  border-radius: 7px;
}
:root .btn-primary:focus {
  box-shadow: none;
  background-color: #41463b;
}
:root .btn-primary:hover {
  background-color: #41463b;
  color: #110B09;
}
:root .btn-primary:active:focus {
  background-color: #2A1D18;
  box-shadow: none;
}
:root .card {
  transition: box-shadow 0.3s ease-in-out, transform 0.3s ease-in-out;
}
:root .card:hover {
  box-shadow: 0px 20px 30px rgba(0, 0, 0, 0.06);
  transform: translateY(-5px);
}
:root .card .card-img-overlay {
  transition: background-color 0.3s ease-in-out, transform 0.3s ease-in-out;
}
:root .card .card-img-overlay:hover {
  background: rgba(0, 0, 0, 0.4);
}
:root .card .card-title {
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 100%;
  color: white;
  font-size: 30px;
  font-weight: bold;
}
:root .coupon-text-container {
  width: 50%;
}
@media (min-width: 1200px) {
  :root .g-custom {
    padding: auto;
  }
}
.container-fluid .footer-logo {
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: center;
}
.container-fluid .footer-logo .contact-container {
  display: flex;
  flex-direction: column;
  align-items: center;
}
.container-fluid .footer-navigation {
  display: flex;
  flex-direction: column;
  width: 30%;
}
.container-fluid .footer-navigation .navigation-txt {
  font-family: Montserrat;
  font-weight: 700;
  font-size: 25px;
  margin-bottom: 10px;
  text-decoration: none;
  color: #828C76;
}
.container-fluid .footer-navigation .footer-link:hover {
  color: white;
  transition: color 0.15s ease-in-out;
}
.container-fluid .footer-coupon {
  display: flex;
  flex-direction: column;
  width: 25%;
}
.container-fluid .footer-coupon span {
  font-size: 1.2rem;
}
.container-fluid {
  padding: 0px;
}
.container-fluid .banner-style {
  position: relative;
}
.container-fluid .img-container {
  background-color: black;
}
.container-fluid .img-container .img-banner {
  opacity: 0.8;
  width: 100%;
}

.form-check .form-check-input {
  height: 0px;
  border: 1px solid #828C76;
  padding: 7px;
}

.form-check-input:focus {
  box-shadow: none;
}

.form-check-input:checked {
  background-color: #828C76;
}

.overlay-container {
  position: absolute;
  top: 0;
  bottom: 0;
  right: 0;
  left: 0;
  z-index: 1;
}
.overlay-container .txt-container {
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 100%;
}
.overlay-container .txt-container .txt-overlay {
  font-weight: bold;
  color: white;
}

.form-style {
  width: 350px;
  border-radius: 20px;
  background-color: #2A1D18;
}
.form-style .form-control {
  border: none;
  color: white;
  background: none;
  outline: none;
}
